[{"location":"#TrackingAPI","page":"Home","title":"TrackingAPI","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for TrackingAPI.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"#Base.Dict-Tuple{SQLite.Row}","page":"Home","title":"Base.Dict","text":"Base.Dict(row::SQLite.Row)::Dict{Symbol,Any}\n\nTransforms a SQLite row into a dictionary.\n\nArguments\n\nrow::SQLite.Row: The row to transform.\n\nReturns\n\nA dictionary representation of the row.\n\n\n\n\n\n","category":"method"},{"location":"#Base.Dict-Tuple{Union{TrackingAPI.ResultType, TrackingAPI.UpsertType}}","page":"Home","title":"Base.Dict","text":"Base.Dict(object::UpsertType)::Dict{String,Any}\n\nTransforms a ResultType or an UpsertType object to a dictionary.\n\nArguments\n\nobject::Union{ResultType,UpsertType}: The object to convert.\n\nReturns\n\nA dictionary representation of the object.\n\n\n\n\n\n","category":"method"},{"location":"#Core.String-Tuple{TrackingAPI.UpsertResult}","page":"Home","title":"Core.String","text":"Base.String(::Type{<:UpsertResult})::String\n\nConvert an UpsertResult type to its string representation in uppercase.\n\nArguments\n\n::Type{<:UpsertResult}: The upsert result type to convert\n\nReturns\n\nA string representation of the upsert result type in uppercase.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.APIConfig","page":"Home","title":"TrackingAPI.APIConfig","text":"APIConfig\n\nA struct to hold the configuration for the API server.\n\nFields\n\nhost: The host of the API server.\nport: The port of the API server.\ndb_file: The path to the SQLite database file.\njwt_secret: The JWT secret for authentication.\nenable_auth: Whether to enable authentication or not.\nenable_api: Whether the API server is enabled or not.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.Created","page":"Home","title":"TrackingAPI.Created","text":"Created\n\nA marker type indicating that a record was successfully created.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.Duplicate","page":"Home","title":"TrackingAPI.Duplicate","text":"Duplicate\n\nA marker type indicating that a record already exists.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.Error","page":"Home","title":"TrackingAPI.Error","text":"Error\n\nA marker type indicating that an error occurred while creating or updating a record.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.Experiment","page":"Home","title":"TrackingAPI.Experiment","text":"Experiment\n\nA struct representing an experiment within a project.\n\nFields\n\nid: The unique identifier of the experiment.\nproject_id: The identifier of the project to which the experiment belongs.\nstatus_id: The status of the experiment.\nname: The name of the experiment.\ndescription: A description of the experiment.\ncreated_date: The date and time when the experiment was created.\nend_date: The date and time when the experiment ended, or nothing if it is still ongoing.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.ExperimentCreatePayload","page":"Home","title":"TrackingAPI.ExperimentCreatePayload","text":"ExperimentCreatePayload\n\nA struct representing the payload for creating a new experiment.\n\nFields\n\nstatus_id: The status of the experiment.\nname: The name of the experiment.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.ExperimentUpdatePayload","page":"Home","title":"TrackingAPI.ExperimentUpdatePayload","text":"ExperimentUpdatePayload\n\nA struct representing the payload for updating an existing experiment.\n\nFields\n\nstatus_id: The status of the experiment, or nothing if not updating.\nname: The name of the experiment, or nothing if not updating.\ndescription: A description of the experiment, or nothing if not updating.\nend_date: The date and time when the experiment ended, or nothing if not updating.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.Iteration","page":"Home","title":"TrackingAPI.Iteration","text":"Iteration\n\nA struct representing an iteration within an experiment.\n\nFields\n\nid: The unique identifier of the iteration.\nexperiment_id: The identifier of the experiment to which the iteration belongs.\nnotes: Notes associated with the iteration.\ncreated_date: The date and time when the iteration was created.\nend_date: The date and time when the iteration ended, or nothing if it is still ongoing.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.IterationUpdatePayload","page":"Home","title":"TrackingAPI.IterationUpdatePayload","text":"IterationUpdatePayload\n\nA struct representing the payload for updating an existing iteration.\n\nFields\n\nnotes: Notes associated with the iteration, or nothing if not updating.\nend_date: The date and time when the iteration ended, or nothing if it is still ongoing.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.Metric","page":"Home","title":"TrackingAPI.Metric","text":"Metric\n\nA struct representing a metric with its details.\n\nFields\n\nid: The ID of the metric.\niteration_id: The ID of the iteration this metric belongs to.\nkey: The key/name of the metric.\nvalue: The value of the metric.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.MetricCreatePayload","page":"Home","title":"TrackingAPI.MetricCreatePayload","text":"MetricCreatePayload\n\nA struct that represents the payload for creating a metric.\n\nFields\n\nkey: The key/name of the metric.\nvalue: The value of the metric.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.MetricUpdatePayload","page":"Home","title":"TrackingAPI.MetricUpdatePayload","text":"MetricUpdatePayload\n\nA struct that represents the payload for updating a metric.\n\nFields\n\nkey: The key/name of the metric, or nothing if not updating.\nvalue: The value of the metric, or nothing if not updating.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.Parameter","page":"Home","title":"TrackingAPI.Parameter","text":"Parameter\n\nA struct representing a parameter with its details.\n\nFields\n\nid: The ID of the parameter.\niteration_id: The ID of the iteration this parameter belongs to.\nkey: The key/name of the parameter.\nvalue: The value of the parameter.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.ParameterCreatePayload","page":"Home","title":"TrackingAPI.ParameterCreatePayload","text":"ParameterCreatePayload\n\nA struct that represents the payload for creating a parameter.\n\nFields\n\nkey: The key/name of the parameter.\nvalue: The value of the parameter.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.ParameterUpdatePayload","page":"Home","title":"TrackingAPI.ParameterUpdatePayload","text":"ParameterUpdatePayload\n\nA struct that represents the payload for updating a parameter.\n\nFields\n\nkey: The key/name of the parameter, or nothing if not updating.\nvalue: The value of the parameter, or nothing if not updating.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.Project","page":"Home","title":"TrackingAPI.Project","text":"Project\n\nA struct representing a project with its details.\n\nFields\n\nid: The ID of the project.\nname: The name of the project.\ndescription: A brief description of the project.\ncreated_date: The date and time the project was created.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.ProjectCreatePayload","page":"Home","title":"TrackingAPI.ProjectCreatePayload","text":"ProjectCreatePayload\n\nA struct that represents the payload for creating a project.\n\nFields\n\nname: The name of the project.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.ProjectUpdatePayload","page":"Home","title":"TrackingAPI.ProjectUpdatePayload","text":"ProjectUpdatePayload\n\nA struct that represents the payload for updating a project.\n\nFields\n\nname: The name of the project, or nothing if not updating.\ndescription: A brief description of the project, or nothing if not updating.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.ResultType","page":"Home","title":"TrackingAPI.ResultType","text":"ResultType\n\nA marker abstract type for result types.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.Unprocessable","page":"Home","title":"TrackingAPI.Unprocessable","text":"Unprocessable\n\nA marker type indicating that a record violates a constraint and cannot be processed.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.Updated","page":"Home","title":"TrackingAPI.Updated","text":"Updated\n\nA marker type indicating that a record was successfully updated.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.UpsertResult","page":"Home","title":"TrackingAPI.UpsertResult","text":"UpsertResult\n\nA marker abstract type for the result of an upsert operation.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.UpsertType","page":"Home","title":"TrackingAPI.UpsertType","text":"UpsertType\n\nA marker abstract type for upsert types.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.User","page":"Home","title":"TrackingAPI.User","text":"User\n\nA struct that represents a user.\n\nFields\n\nid: The ID of the user.\nfirst_name: The first name of the user.\nlast_name: The last name of the user.\nusername: The username of the user.\npassword: The password of the user. This is a hashed version of the password, not the plain text password.\ncreated_date: The date and time the user was created.\nis_admin: Whether the user is an administrator.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.UserCreatePayload","page":"Home","title":"TrackingAPI.UserCreatePayload","text":"UserCreatePayload\n\nA struct that represents the payload for creating a user.\n\nFields\n\nfirst_name: The first name of the user.\nlast_name: The last name of the user.\nusername: The username of the user.\npassword: The password of the user.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.UserLoginPayload","page":"Home","title":"TrackingAPI.UserLoginPayload","text":"UserLoginPayload\n\nA struct that represents the payload for user login.\n\nFields\n\nusername: The username of the user.\npassword: The password of the user.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.UserPermission","page":"Home","title":"TrackingAPI.UserPermission","text":"UserPermission\n\nA struct representing a user's permissions for a specific project.\n\nFields\n\nid: The unique identifier for the user permission record.\nuser_id: The ID of the user.\nproject_id: The ID of the project.\ncreate_permission: Permission to create resources.\nread_permission: Permission to read resources.\nupdate_permission: Permission to update resources.\ndelete_permission: Permission to delete resources.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.UserPermissionCreatePayload","page":"Home","title":"TrackingAPI.UserPermissionCreatePayload","text":"UserPermissionCreatePayload\n\nA struct that represents the payload for creating a user permission.\n\nFields\n\ncreate_permission: Permission to create resources.\nread_permission: Permission to read resources.\nupdate_permission: Permission to update resources.\ndelete_permission: Permission to delete resources.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.UserPermissionUpdatePayload","page":"Home","title":"TrackingAPI.UserPermissionUpdatePayload","text":"UserPermissionUpdatePayload\n\nA struct that represents the payload for updating a user permission.\n\nFields\n\ncreate_permission: Permission to create resources, or nothing if not updating.\nread_permission: Permission to read resources, or nothing if not updating.\nupdate_permission: Permission to update resources, or nothing if not updating.\ndelete_permission: Permission to delete resources, or nothing if not updating.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.UserUpdatePayload","page":"Home","title":"TrackingAPI.UserUpdatePayload","text":"UserUpdatePayload\n\nA struct that represents the payload for updating a user.\n\nFields\n\nfirst_name: The first name of the user, or nothing if not updating.\nlast_name: The last name of the user, or nothing if not updating.\npassword: The password of the user, or nothing if not updating.\nis_admin: Whether the user is an administrator, or nothing if not updating.\n\n\n\n\n\n","category":"type"},{"location":"#TrackingAPI.compare_object_fields-Tuple{TrackingAPI.ResultType}","page":"Home","title":"TrackingAPI.compare_object_fields","text":"compare_object_fields(object::ResultType; kwargs...)::Bool\n\nChecks if the object fields are different from the provided keyword arguments.\n\nArguments\n\nobject::ResultType: The object to check.\nkwargs...: The keyword arguments to compare with the object fields.\n\nReturns\n\ntrue if any of the object fields are different from the provided keyword arguments, false otherwise.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.create_experiment-Tuple{Integer, TrackingAPI.ExperimentCreatePayload}","page":"Home","title":"TrackingAPI.create_experiment","text":"create_experiment(project_id::Integer, experiment_payload::ExperimentCreatePayload)::Tuple{Optional{<:Int64},UpsertResult}\n\nCreate a Experiment.\n\nArguments\n\nproject_id::Integer: The id of the project to create the experiment for.\nexperiment_payload::ExperimentCreatePayload: The payload for creating an experiment.\n\nReturns\n\nAn UpsertResult. Created if the record was successfully created, Duplicate if the record already exists, Unprocessable if the record violates a constraint, and Error if an error occurred while creating the record.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.create_iteration-Tuple{Integer}","page":"Home","title":"TrackingAPI.create_iteration","text":"create_iteration(experiment_id::Integer)::Tuple{Optional{<:Int64},UpsertResult}\n\nArguments\n\nexperiment_id::Integer: The id of the experiment to create the iteration for.\n\nReturns\n\nAn UpsertResult. Created if the record was successfully created, Duplicate if the record already exists, Unprocessable if the record violates a constraint, and Error if an error occurred while creating the record.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.create_metric-Tuple{Integer, TrackingAPI.MetricCreatePayload}","page":"Home","title":"TrackingAPI.create_metric","text":"create_metric(iteration_id::Integer, metric_payload::MetricCreatePayload)::Tuple{Optional{<:Int64},UpsertResult}\n\nArguments\n\niteration_id::Integer: The id of the iteration to create the metric for.\nmetric_payload::MetricCreatePayload: The payload for creating a metric.\n\nReturns\n\nAn UpsertResult. Created if the record was successfully created, Duplicate if the record already exists, Unprocessable if the record violates a constraint, and Error if an error occurred while creating the record.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.create_parameter-Tuple{Integer, TrackingAPI.ParameterCreatePayload}","page":"Home","title":"TrackingAPI.create_parameter","text":"create_parameter(iteration_id::Integer, parameter_payload::ParameterCreatePayload)::Tuple{Optional{<:Int64},UpsertResult}\n\nArguments\n\niteration_id::Integer: The id of the iteration to create the parameter for.\nparameter_payload::ParameterCreatePayload: The payload for creating a parameter.\n\nReturns\n\nAn UpsertResult. Created if the record was successfully created, Duplicate if the record already exists, Unprocessable if the record violates a constraint, and Error if an error occurred while creating the record.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.create_project-Tuple{Integer, TrackingAPI.ProjectCreatePayload}","page":"Home","title":"TrackingAPI.create_project","text":"create_project(user_id::Integer, project_payload::ProjectCreatePayload)::Tuple{Optional{<:Int64},UpsertResult}\n\nCreate a Project.\n\nArguments\n\nuser_id::Integer: The id of the user creating the project. The user must have admin privileges.\nproject_payload::ProjectCreatePayload: The payload for creating an project.\n\nReturns\n\nAn UpsertResult. Created if the record was successfully created, Duplicate if the record already exists, Unprocessable if the record violates a constraint, and Error if an error occurred while creating the record.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.create_user-Tuple{TrackingAPI.UserCreatePayload}","page":"Home","title":"TrackingAPI.create_user","text":"create_user(user_payload::UserCreatePayload)::Tuple{Optional{<:Int64},UpsertResult}\n\nCreate an User.\n\nArguments\n\nuser_payload::UserCreatePayload: The payload for creating an user.\n\nReturns\n\nAn UpsertResult. Created if the record was successfully created, Duplicate if the record already exists, Unprocessable if the record violates a constraint, and Error if an error occurred while creating the record.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.create_userpermission-Tuple{Integer, Integer, TrackingAPI.UserPermissionCreatePayload}","page":"Home","title":"TrackingAPI.create_userpermission","text":"create_userpermission(user_id::Integer, project_id::Integer, userpermission_payload::UserPermissionCreatePayload)::Tuple{Optional{<:Int64},UpsertResult}\n\nCreate a UserPermission.\n\nArguments\n\nuser_id::Integer: The id of the user.\nproject_id::Integer: The id of the project.\nuserpermission_payload::UserPermissionCreatePayload: The payload for creating a user permission.\n\nReturns\n\nAn UpsertResult. Created if the record was successfully created, Duplicate if the record already exists, Unprocessable if the record violates a constraint, and Error if an error occurred while creating the record.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.delete-Tuple{AbstractString, Integer}","page":"Home","title":"TrackingAPI.delete","text":"delete(query::AbstractString, id::Integer)::Bool\n\nDelete a record from the database.\n\nArguments\n\nquery::AbstractString: The query to execute.\nid::Integer: The ID of the record to delete.\n\nReturns\n\ntrue if the record was successfully deleted, false otherwise.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.delete_experiment-Tuple{Integer}","page":"Home","title":"TrackingAPI.delete_experiment","text":"delete_experiment(id::Integer)::Bool\n\nDelete a Experiment record. Also deletes all associated Iteration.\n\nArguments\n\nid::Integer: The id of the experiment to delete.\n\nReturns\n\ntrue if the record was successfully deleted, false otherwise.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.delete_iteration-Tuple{Integer}","page":"Home","title":"TrackingAPI.delete_iteration","text":"delete_iteration(id::Integer)::Bool\n\nDelete a Iteration record.\n\nArguments\n\nid::Integer: The id of the iteration to delete.\n\nReturns\n\ntrue if the record was successfully deleted, false otherwise.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.delete_metric-Tuple{Integer}","page":"Home","title":"TrackingAPI.delete_metric","text":"delete_metric(id::Integer)::Bool\n\nDelete a Metric record.\n\nArguments\n\nid::Integer: The id of the metric to delete.\n\nReturns\n\ntrue if the record was successfully deleted, false otherwise.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.delete_metrics-Tuple{TrackingAPI.Iteration}","page":"Home","title":"TrackingAPI.delete_metrics","text":"delete_metrics(iteration::Iteration)::Bool\n\nDelete all Metric records associated with a given Iteration.\n\nArguments\n\niteration::Iteration: The iteration whose metrics are to be deleted.\n\nReturns\n\ntrue if the records were successfully deleted, false otherwise.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.delete_parameter-Tuple{Integer}","page":"Home","title":"TrackingAPI.delete_parameter","text":"delete_parameter(id::Integer)::Bool\n\nDelete a Parameter record.\n\nArguments\n\nid::Integer: The id of the parameter to delete.\n\nReturns\n\ntrue if the record was successfully deleted, false otherwise.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.delete_parameters-Tuple{TrackingAPI.Iteration}","page":"Home","title":"TrackingAPI.delete_parameters","text":"delete_parameters(iteration::Iteration)::Bool\n\nDelete all Parameter records associated with a given Iteration.\n\nArguments\n\niteration::Iteration: The iteration whose parameters are to be deleted.\n\nReturns\n\ntrue if the records were successfully deleted, false otherwise.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.delete_project-Tuple{Integer}","page":"Home","title":"TrackingAPI.delete_project","text":"delete_project(id::Integer)::Bool\n\nDelete a Project record. Also deletes all associated UserPermission and Experiment records.\n\nArguments\n\nid::Integer: The id of the project to delete.\n\nReturns\n\ntrue if the record was successfully deleted, false otherwise.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.delete_user-Tuple{Integer}","page":"Home","title":"TrackingAPI.delete_user","text":"delete_user(id::Integer)::Bool\n\nDelete an User. Also deletes all associated UserPermission.\n\nArguments\n\nid::Integer: The id of the user to delete.\n\nReturns\n\ntrue if the record was successfully deleted, false otherwise.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.delete_userpermission-Tuple{Integer}","page":"Home","title":"TrackingAPI.delete_userpermission","text":"delete_userpermission(id::Integer)::Bool\n\nDelete a UserPermission.\n\nArguments\n\nid::Integer: The id of the user permission to delete.\n\nReturns\n\ntrue if the record was successfully deleted, false otherwise.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.fetch-Tuple{AbstractString, NamedTuple}","page":"Home","title":"TrackingAPI.fetch","text":"fetch(query::AbstractString, parameters::NamedTuple)::Optional{Dict{Symbol,Any}}\n\nFetch a record from the database.\n\nArguments\n\nquery::AbstractString: The query to execute.\nparameters::NamedTuple: The query parameters.\n\nReturns\n\nA dictionary of the record. If the record does not exist, return nothing.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.fetch_all-Tuple{AbstractString}","page":"Home","title":"TrackingAPI.fetch_all","text":"fetch_all(query::AbstractString; parameters::NamedTuple=(;))::Array{Dict{Symbol,Any},1}\n\nFetch all records from the database.\n\nArguments\n\nquery::AbstractString: The query to execute.\nparameters::NamedTuple: The query parameters.\n\nReturns\n\nAn array of dictionaries of the records.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.get_database-Tuple{}","page":"Home","title":"TrackingAPI.get_database","text":"get_database()::SQLite.DB\n\nReturns a SQLite database connection. The database file is specified by the TRACKINGAPI_DB_FILE environment variable. If the variable is not set, the default value is trackingapi.db in the current directory.\n\nReturns\n\nA SQLite.DB object.\n\nnote: Note\n\n\nThe function is memoized, so the database connection will be reused across calls.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.get_experiment_by_id-Tuple{Integer}","page":"Home","title":"TrackingAPI.get_experiment_by_id","text":"get_experiment_by_id(id::Integer)::Optional{Experiment}\n\nGet a Experiment by id.\n\nArguments\n\nid::Integer: The id of the experiment to query.\n\nReturns\n\nA Experiment object. If the record does not exist, return nothing.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.get_experiments-Tuple{Integer}","page":"Home","title":"TrackingAPI.get_experiments","text":"get_experiments(project_id::Integer)::Array{Experiment, 1}\n\nGet all Experiment for a given project.\n\nArguments\n\nproject_id::Integer: The id of the project to query.\n\nReturns\n\nAn array of Experiment objects.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.get_iteration_by_id-Tuple{Integer}","page":"Home","title":"TrackingAPI.get_iteration_by_id","text":"get_iteration_by_id(id::Integer)::Optional{Iteration}\n\nGet a Iteration by id.\n\nArguments\n\nid::Integer: The id of the iteration to query.\n\nReturns\n\nA Iteration object. If the record does not exist, return nothing.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.get_iterations-Tuple{Integer}","page":"Home","title":"TrackingAPI.get_iterations","text":"get_iterations(experiment_id::Integer)::Array{Iteration, 1}\n\nGet all Iteration for a given experiment.\n\nArguments\n\nexperiment_id::Integer: The id of the experiment to query.\n\nReturns\n\nAn array of Iteration objects.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.get_metric_by_id-Tuple{Integer}","page":"Home","title":"TrackingAPI.get_metric_by_id","text":"get_metric_by_id(id::Integer)::Optional{Metric}\n\nGet a Metric by id.\n\nArguments\n\nid::Integer: The id of the metric to query.\n\nReturns\n\nA Metric object. If the record does not exist, return nothing.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.get_metrics-Tuple{Integer}","page":"Home","title":"TrackingAPI.get_metrics","text":"get_metrics(iteration_id::Integer)::Array{Metric, 1}\n\nGet all Metric for a given iteration.\n\nArguments\n\niteration_id::Integer: The id of the iteration to query.\n\nReturns\n\nAn array of Metric objects.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.get_parameter_by_id-Tuple{Integer}","page":"Home","title":"TrackingAPI.get_parameter_by_id","text":"get_parameter_by_id(id::Integer)::Optional{Parameter}\n\nGet a Parameter by id.\n\nArguments\n\nid::Integer: The id of the parameter to query.\n\nReturns\n\nA Parameter object. If the record does not exist, return nothing.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.get_parameters-Tuple{Integer}","page":"Home","title":"TrackingAPI.get_parameters","text":"get_parameters(iteration_id::Integer)::Array{Parameter, 1}\n\nGet all Parameter for a given iteration.\n\nArguments\n\niteration_id::Integer: The id of the iteration to query.\n\nReturns\n\nAn array of Parameter objects.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.get_project_by_id-Tuple{Integer}","page":"Home","title":"TrackingAPI.get_project_by_id","text":"get_project_by_id(id::Integer)::Optional{Project}\n\nGet a Project by id.\n\nArguments\n\nid::Integer: The id of the project to query.\n\nReturns\n\nA Project object. If the record does not exist, return nothing.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.get_projects-Tuple{}","page":"Home","title":"TrackingAPI.get_projects","text":"get_projects()::Array{Project, 1}\n\nGet all Project.\n\nReturns\n\nAn array of Project objects.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.get_status_by_upsert_result-Tuple{TrackingAPI.Created}","page":"Home","title":"TrackingAPI.get_status_by_upsert_result","text":"get_status_by_upsert_result(UpsertResult)::HTTP.StatusCodes\n\nReturn the appropriate HTTP status code based on the upsert result.\n\nTable of conversions\n\nCreated -> HTTP.StatusCodes.CREATED\nUpdated -> HTTP.StatusCodes.OK\nDuplicate -> HTTP.StatusCodes.CONFLICT\nUnprocessable -> HTTP.StatusCodes.UNPROCESSABLE_ENTITY\nError -> HTTP.StatusCodes.INTERNAL_SERVER_ERROR\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.get_user_by_id-Tuple{Integer}","page":"Home","title":"TrackingAPI.get_user_by_id","text":"get_user_by_id(id::Integer)::Optional{User}\n\nGet an User by id.\n\nArguments\n\nid::Integer: The id of the user to query.\n\nReturns\n\nAn User object. If the record does not exist, return nothing.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.get_user_by_username-Tuple{AbstractString}","page":"Home","title":"TrackingAPI.get_user_by_username","text":"get_user_by_username(username::AbstractString)::Optional{User}\n\nGet an User by username.\n\nArguments\n\nusername::AbstractString: The username of the user to query.\n\nReturns\n\nAn User object. If the record does not exist, return nothing.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.get_userpermission_by_user_and_project-Tuple{Integer, Integer}","page":"Home","title":"TrackingAPI.get_userpermission_by_user_and_project","text":"get_userpermission_by_user_and_project(user_id::Integer, project_id::Integer)::Optional{UserPermission}\n\nGet a UserPermission by User id and Project IDs.\n\nArguments\n\nuser_id::Integer: The id of the user.\nproject_id::Integer: The id of the project.\n\nReturns\n\nA UserPermission object. If the record does not exist, return nothing.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.get_users-Tuple{}","page":"Home","title":"TrackingAPI.get_users","text":"get_users()::Array{User, 1}\n\nGet all User.\n\nReturns\n\nAn array of User objects.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.get_users_by_project_id-Tuple{Integer}","page":"Home","title":"TrackingAPI.get_users_by_project_id","text":"get_users_by_project_id(project_id::Integer)::Array{User, 1}\n\nGet all User associated with a specific project.\n\nArguments\n\nproject_id::Integer: The ID of the project.\n\nReturns\n\nAn array of User objects.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.initialize_database-Tuple{}","page":"Home","title":"TrackingAPI.initialize_database","text":"initialize_database(; database::SQLite.DB=get_database())\n\nInitializes the database by creating the necessary tables.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.insert-Tuple{AbstractString, NamedTuple}","page":"Home","title":"TrackingAPI.insert","text":"insert(query::AbstractString, parameters::NamedTuple)::Tuple{Optional{<:Int64},UpsertResult}\n\nInsert a record into the database.\n\nArguments\n\nquery::AbstractString: The query to execute.\nparameters::NamedTuple: The query parameters.\n\nReturns\n\nThe inserted record ID. If an error occurs, nothing is returned.\nAn UpsertResult. Created if the record was successfully created, Duplicate if the record already exists, Unprocessable if the record violates a constraint, and Error if an error occurred while creating the record.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.load_config-Tuple{AbstractString}","page":"Home","title":"TrackingAPI.load_config","text":"load_config(file::AbstractString)\n\nLoad environment variables from a file.\n\nArguments\n\nfile::AbstractString: The path to the file containing environment variables.\n\nReturns\n\nAn APIConfig object containing the loaded environment variables.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.run-Tuple{}","page":"Home","title":"TrackingAPI.run","text":"run(; env_file::String=\".env\")\n\nStarts the server.\n\nBy default, the server will run on 127.0.0.1:9000. You can change both the host and port by modifying the .env file specific entries. The environment variables are loaded from the .env file by default. You can change the file path by passing the env_file argument.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.stop-Tuple{}","page":"Home","title":"TrackingAPI.stop","text":"stop()\n\nStops the server. Alias for Oxygen.Core.terminate().\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.type_from_dict-Union{Tuple{K}, Tuple{T}, Tuple{Type{T}, Dict{K, Any}, TrackingAPI.KeyConversionTrait}} where {T, K}","page":"Home","title":"TrackingAPI.type_from_dict","text":"type_from_dict(::Type{T}, data::Dict{K,Any}, trait::KeyConversionTrait)::T where {T, K}\n\nBuilds an instance of type T from a dictionary data with trait related to the type K. All the fields in the struct T must be present in the dictionary.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.update-Tuple{AbstractString, Union{Nothing, TrackingAPI.ResultType}}","page":"Home","title":"TrackingAPI.update","text":"update(query::AbstractString, object::Optional{<:ResultType}; parameters...)::UpsertResult\n\nUpdate a record in the database.\n\nArguments\n\nquery::AbstractString: The query to execute.\nobject::Optional{<:UpsertType}: The object to update.\nparameters: The fields to update.\n\nReturns\n\nAn UpsertResult. Updated if the record was successfully updated, Unprocessable if the record violates a constraint, and Error if an error occurred.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.update_experiment-Tuple{Integer, TrackingAPI.ExperimentUpdatePayload}","page":"Home","title":"TrackingAPI.update_experiment","text":"update_experiment(id::Integer, experiment_payload::ExperimentUpdatePayload)::UpsertResult\n\nUpdate a Experiment record.\n\nArguments\n\nid::Integer: The id of the experiment to update.\nexperiment_payload::ExperimentUpdatePayload: The payload for updating the experiment.\n\nReturns\n\nAn UpsertResult. Updated if the record was successfully updated (or no changes were made), Duplicate if the record already exists, Unprocessable if the record violates a constraint, and Error if an error occurred while creating the record.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.update_iteration-Tuple{Integer, TrackingAPI.IterationUpdatePayload}","page":"Home","title":"TrackingAPI.update_iteration","text":"update_iteration(id::Int, iteration_payload::IterationUpdatePayload)::UpsertResult\n\nUpdate a Iteration record.\n\nArguments\n\nid::Integer: The id of the iteration to update.\niteration_payload::IterationUpdatePayload: The payload for updating the iteration.\n\nReturns\n\nAn UpsertResult. Updated if the record was successfully updated (or no changes were made), Duplicate if the record already exists, Unprocessable if the record violates a constraint, and Error if an error occurred while creating the record.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.update_metric-Tuple{Integer, TrackingAPI.MetricUpdatePayload}","page":"Home","title":"TrackingAPI.update_metric","text":"update_metric(id::Integer, metric_payload::MetricUpdatePayload)::UpsertResult\n\nUpdate a Metric record.\n\nArguments\n\nid::Integer: The id of the metric to update.\nmetric_payload::MetricUpdatePayload: The payload for updating the metric.\n\nReturns\n\nAn UpsertResult. Updated if the record was successfully updated (or no changes were made), Duplicate if the record already exists, Unprocessable if the record violates a constraint, and Error if an error occurred while creating the record.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.update_parameter-Tuple{Integer, TrackingAPI.ParameterUpdatePayload}","page":"Home","title":"TrackingAPI.update_parameter","text":"update_parameter(id::Integer, parameter_payload::ParameterUpdatePayload)::UpsertResult\n\nUpdate a Parameter record.\n\nArguments\n\nid::Integer: The id of the parameter to update.\nparameter_payload::ParameterUpdatePayload: The payload for updating the parameter.\n\nReturns\n\nAn UpsertResult. Updated if the record was successfully updated (or no changes were made), Duplicate if the record already exists, Unprocessable if the record violates a constraint, and Error if an error occurred while creating the record.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.update_project-Tuple{Integer, TrackingAPI.ProjectUpdatePayload}","page":"Home","title":"TrackingAPI.update_project","text":"update_project(id::Int, project_payload::ProjectUpdatePayload)::UpsertResult\n\nUpdate a Project record.\n\nArguments\n\nid::Integer: The id of the project to update.\nproject_payload::ProjectUpdatePayload: The payload for updating a project.\n\nReturns\n\nAn UpsertResult. Updated if the record was successfully updated (or no changes were made), Duplicate if the record already exists, Unprocessable if the record violates a constraint, and Error if an error occurred while creating the record.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.update_user-Tuple{Integer, TrackingAPI.UserUpdatePayload}","page":"Home","title":"TrackingAPI.update_user","text":"update_user(id::Integer, user_payload::UserUpdatePayload)::UpsertResult\n\nUpdate an User.\n\nArguments\n\nid::Integer: The id of the user to update.\nuser_payload::UserUpdatePayload: The payload for updating an user.\n\nReturns\n\nAn UpsertResult. Updated if the record was successfully updated (or no fields were changed), Unprocessable if the record violates a constraint or if no fields were provided to update, and Error if an error occurred while updating the record.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.update_userpermission-Tuple{Integer, TrackingAPI.UserPermissionUpdatePayload}","page":"Home","title":"TrackingAPI.update_userpermission","text":"update_userpermission(id::Integer, userpermission_payload::UserPermissionUpdatePayload)::UpsertResult\n\nUpdate a UserPermission.\n\nArguments\n\nid::Integer: The id of the user permission to update.\nuserpermission_payload::UserPermissionUpdatePayload: The payload for updating a user permission.\n\nReturns\n\nAn UpsertResult. Updated if the record was successfully updated (or no fields were changed), Unprocessable if the record violates a constraint or if no fields were provided to update, and Error if an error occurred while updating the record.\n\n\n\n\n\n","category":"method"},{"location":"#TrackingAPI.@admin_required-Tuple{Any}","page":"Home","title":"TrackingAPI.@admin_required","text":"@admin_required function_name(::HTTP.Request, args...)::HTTP.Response\n\nA macro to enforce that the user making the request has administrative privileges.\n\n\n\n\n\n","category":"macro"},{"location":"#TrackingAPI.@same_user_or_admin_required-Tuple{Any}","page":"Home","title":"TrackingAPI.@same_user_or_admin_required","text":"@same_user_or_admin_required function_name(::HTTP.Request, id::Int, args...)::HTTP.Response\n\nA macro to enforce that the user making the request is either an administrator or the owner of the resource being accessed.\n\n\n\n\n\n","category":"macro"}]
